import React from "react";
import { useNavigate, useParams } from "react-router-dom";
import * as T from "../styles/StyledTalk";

const Talk = () => {
  const navigate = useNavigate();

  const goback = () => {
    navigate(`/`);
  };

  return (
    <T.Container>
      <header></header>
      <footer></footer>
    </T.Container>
  );
};

export default Talk;
